def findPos(arr, N):
    start = 0
    end = len(arr)-1
    if N > arr[-1]:
        return -1
    elif N < arr[0]:
        return 0
    #using binary search for the first element larger than the current N
    while start <= end:
            mid = (start + end) // 2
            if arr[mid] < N:
                start = mid +1
            else:
                end = mid-1
    return start

def findRadius(houses: 'List[int]', heaters: 'List[int]'):
    maxTemp = 0
    temp = 0
    houses = list(set(houses) - set(heaters)) #only the one not listed in the heaters should be searched for.
    heaters = sorted(heaters)
    for i in houses:
        if i not in heaters:
            pos = findPos(heaters, i)
            if pos == 0:
                temp =  heaters[0] - i
            elif pos == -1:
                temp = i - heaters[-1]
            else:
                temp = min( i - heaters[pos-1] , heaters[pos] -i)

        maxTemp = max(maxTemp, temp )
            #print(i,pos, diff, heaters)
    return maxTemp

